import { Component } from '@angular/core';
import { Router } from '@angular/router';
import { ToastrService } from 'ngx-toastr';
import { ApiService } from 'src/app/services/api.service';
import * as pdfMake from "pdfmake/build/pdfmake";
import * as pdfFonts from 'pdfmake/build/vfs_fonts';
import html2canvas from 'html2canvas';
(<any>pdfMake).vfs = pdfFonts.pdfMake.vfs;
import { TDocumentDefinitions } from 'pdfmake/interfaces';
import { jsPDF } from "jspdf";
import DomToImage from 'dom-to-image';
import axios from 'axios';
import * as moment from 'moment';

@Component({
  selector: 'app-cert-stud',
  templateUrl: './cert-stud.component.html',
  styleUrls: ['./cert-stud.component.scss']
})
export class CertStudComponent {

  students: any[] = [];
  certTemplates: any[] = [];
  selectedTemplate: any;
  template: any;
  filter = {
    academicYear: 'select',
    studentClass: 'select',
    section: 'select',
    template: '',
    printDate: ''
  };
  isLoading = false;
  canvasWrapper: HTMLElement;

  constructor(private api: ApiService, private toastr: ToastrService, private router: Router) {
    this.filter.printDate = moment().format('YYYY-MM-DD');
  }

  ngOnInit(): void {
    this.getAllStudents();
  }

  getAllStudents()
  {
    this.api.getAllStudents().subscribe((res)=>{
      this.students = res.students;
      this.getApplicableCertificates();
    });
  }

  getApplicableCertificates() {
    this.api.getApplicableCertificates('Student').subscribe((res)=>{
      this.certTemplates = res.certificates;
      if(this.certTemplates.length) {
        this.filter.template = this.certTemplates[0].name;
        this.selectedTemplate = this.certTemplates[0];
      }
    });
  }

  getFilteredStudents()
  {
    if(this.filter.academicYear != 'select' || this.filter.studentClass != 'select' || this.filter.section != 'select')

    this.api.studentSearch(this.filter).subscribe((res)=> {
      this.students = res.students;
    });
  }

  printPreview(stud: any)
  {
    this.template = JSON.parse(JSON.stringify(this.selectedTemplate));
    this.template.content = this.template.content.replaceAll(`{{category}}`, stud.caste);
    this.template.content = this.template.content.replaceAll(`{{printDate}}`,
      moment(this.filter.printDate, 'YYYY-MM-DD').format('DD, MMMM, YYYY'));
    stud.admissionDate = moment(stud.admissionDate).format('DD-MM-YYYY');

    for(let key in stud)
    {
      if(key == 'guardian' || key == 'academic') {
        for(let subKey in stud[key]) {
          this.template.content = this.template.content.replaceAll(`{{${key}.${subKey}}}`, stud[key][subKey]);
        }
      }
      else {
        this.template.content = this.template.content.replaceAll(`{{${key}}}`, stud[key]);
      }
    }

    const div = document.createElement('div');
    div.innerHTML = this.template.content;
    const wrapper = document.getElementById('print-wrapper');
    if(wrapper?.children.length) {
      wrapper.removeChild(wrapper.children[0]);
    }

    this.canvasWrapper = wrapper?.appendChild(div) as HTMLElement;
    this.canvasWrapper.style.margin = '10px';
    /* this.canvasWrapper.style.paddingLeft = this.selectedTemplate.layoutSpacing.left + 'px';
    this.canvasWrapper.style.paddingTop = this.selectedTemplate.layoutSpacing.top + 'px';
    this.canvasWrapper.style.paddingRight = this.selectedTemplate.layoutSpacing.right + 'px';
    this.canvasWrapper.style.paddingBottom = this.selectedTemplate.layoutSpacing.bottom + 'px'; */

    /* if(this.canvasWrapper.parentElement) {
      this.canvasWrapper.style.backgroundImage = "url(data:image/jpeg;base64,)";
      this.canvasWrapper.style.backgroundRepeat = 'no-repeat';
      this.canvasWrapper.style.backgroundSize = '100% 100%';
      this.canvasWrapper.style.backgroundPosition = 'center center';
      this.canvasWrapper.style.padding = '80px'

    } */

    if(this.canvasWrapper.parentElement) {
      this.canvasWrapper.style.backgroundImage = `url(${this.selectedTemplate.backgroundImage})`;
      this.canvasWrapper.style.backgroundRepeat = 'no-repeat';
      this.canvasWrapper.style.backgroundSize = '100% 100%';
      this.canvasWrapper.style.backgroundPosition = 'center center';
      this.canvasWrapper.style.padding = '80px';
    }
  }

  async printPdf()
  {
      /* DomToImage.toPng(this.canvasWrapper).then(base64 => {
        const imageData = base64;
        const doc = new jsPDF({
          orientation: "landscape",
        });

        const imageProps = doc.getImageProperties(imageData);
        const width = doc.internal.pageSize.getWidth();
        const height = (imageProps.height * width) / imageProps.width;

        doc.addImage(imageData, "PNG", 0, 0, width, height);
        doc.save('doc.pdf');
      }) */


      html2canvas(this.canvasWrapper, {
        allowTaint: true,
        foreignObjectRendering: true
      }).then(canvas => {
        const imageData = canvas.toDataURL('image/jpeg');
        const doc = new jsPDF({
          orientation: "landscape",
        });

        const imageProps = doc.getImageProperties(imageData);
        const width = doc.internal.pageSize.getWidth();
        const height = (imageProps.height * width) / imageProps.width;

        doc.addImage(imageData, "PNG", 0, 0, width, height);
        doc.save('doc.pdf');
      /* const docDefinition: TDocumentDefinitions = {
        pageSize: {
          width: 842,
          height: 'auto'
        },
        background: {
          image: this.bas64Img,
          width: 824,
        },
        content: [{
          image: canvas.toDataURL(),
          width: 780
        }]
      }

      pdfMake.createPdf(docDefinition).print(); */
    });
  }
}
